import React, { useState, useEffect } from 'react';
import { useNavigate, useParams } from 'react-router-dom';
import AdminService from '../../services/AdminService';

const CreatePlanComponent = () => {
    //step 2
    const { id } = useParams();
    const [fullName, setFullName] = useState('');
    const [password, setPassword] = useState('');
    const [confirm_password, setConfirmPassword] = useState('');
    const [email, setEmail] = useState('');
    const [city, setCity] = useState('');
    const [contact_no, setContactNo] = useState('');
    const navigate = useNavigate();
    const handleFullNameChange = (event) => {
        setFullName(event.target.value);
    };
    const handlePasswordChange = (event) => {
        setPassword(event.target.value);
    };
    const handleConfirmPasswordChange = (event) => {
        setConfirmPassword(event.target.value);
    };
    const handleEmailChange = (event) => {
        setEmail(event.target.value);
    };
    const handleCityChange = (event) => {
        setCity(event.target.value);
    };
    const handleContactNoChange = (event) => {
        setContactNo(event.target.value);
    };
    //step 3
    useEffect(() => {
        // Fetch employee data when the component mounts
        //step 4
        if (!id || id === "-1") {
            return;
        }
        else {
            const fetchTravelPlanData = async () => {
                try {
                    const response = await AdminService.getPlanById(id);
                    const travelplan = response.data;

                    // Set the state with the fetched employee data
                    setOrigin(travelplan.origin);
                    setDestination(travelplan.destination);
                    setStartDate(travelplan.startDate);
                    setEndDate(travelplan.endDate);
                    setDescription(travelplan.description);
                    setBudget(travelplan.budget);
                    setImageURL(travelplan.imageUrl);

                } catch (error) {
                    console.error('Error fetching travel data:', error);
                }
            };

            fetchTravelPlanData();
        }
    }, [id]);

    const registerUser = (event) => {
        event.preventDefault();
        let UserData = {
            fullName: fullName,
            email: email,
            password: password,
            city: city,
            contact_no: contact_no
        };
        console.log('User Data:', JSON.stringify(UserData));
        AuthService.createUser(UserData).then((res) => {
            navigate('/travelplans/');
        });
    };
    const cancel = (event) => {
        navigate('/travelplans');
    };
    return (
        <div>
            <div className="container">
                <div className="row">
                    <div className="card col-md-6 offset-md-3">
                        User Registration
                        <div className="card-body">
                            <form>
                                <div className="form-group">
                                    <label htmlFor="Origin">Full Name:</label>
                                    <input
                                        type="text"
                                        className="form-control"
                                        id="fullName"
                                        placeholder="Enter Full Name"
                                        value={fullName}
                                        onChange={handleFullNameChange}
                                    />
                                </div>
                                <div className="form-group">
                                    <label htmlFor="destination">Email ID:</label>
                                    <input
                                        type="text"
                                        className="form-control"
                                        id="email"
                                        placeholder="Enter Email ID"
                                        value={email}
                                        onChange={handleEmailChange}
                                    />
                                </div>
                                <div className="form-group">
                                    <label htmlFor="">Password:</label>
                                    <textarea
                                        type="password"
                                        rows="3"
                                        className="form-control"
                                        id="password"
                                        placeholder="Enter Password"
                                        value={password}
                                        onChange={handlePasswordChange}
                                    />
                                </div>
                                <div className="form-group">
                                    <label htmlFor="budget">Confirm Password:</label>
                                    <input
                                        type="password"
                                        className="form-control"
                                        id="confirm_password"
                                        placeholder="Enter Password"
                                        value={confirm_password}
                                        onChange={handleConfirmPasswordChange}
                                    />
                                </div>
                                <div className="form-group">
                                    <label htmlFor="startdate">City:</label>
                                    <input
                                        type="text"
                                        className="form-control"
                                        id="city"
                                        placeholder="Enter Current City"
                                        value={city}
                                        onChange={handleCityChange}
                                    />
                                </div>
                                <div className="form-group">
                                    <label htmlFor="contact_no">Coontact Number:</label>
                                    <input
                                        type="number"
                                        className="form-control"
                                        id="contact_no"
                                        placeholder="Enter Contact Number"
                                        value={contact_no}
                                        onChange={handleContactNoChange}
                                    />
                                </div>


                                <button className='btn btn-success' onClick={registerUser}>Register</button>
                                <button className='btn btn-danger' onClick={cancel} style={{ marginLeft: "10px" }}>Cancel</button>
                            </form>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default CreatePlanComponent;
